import React from 'react'
import './style.css'

const Navbar=(props)=>{

    
    const submit=(e)=>{
e.preventDefault();
alert('searched');
    }
    return(
<div className="navbar">
    <ul className="navbarMenu">
        <a href="#">Home</a>
        <a href="#">Posts</a>
        <a href="#">Categories</a>
        <a href="#">Strories</a>



    </ul>
    <div className="Search">
        <form onSubmit={submit}>
        <input type = "text" className="searchinput" placeholder="Search"/>
        <img src={require('../../assets/icons/search.png').default} alt= "Search"/>
        </form>
    </div>
</div>
    )
}
export default Navbar;
